import Vue from 'vue'
import ElementUI from 'element-ui';
import 'element-ui/lib/theme-chalk/index.css';
import App from './hellomattermost.vue'

Vue.config.productionTip = false

Vue.use(ElementUI);

Vue.use(Button);
Vue.use(Menu);
Vue.use(Steps);

new Vue({
  render: h => h(App),
}).$mount('#app')
